import "./style.css";

import React from "react";

const ChatbotModal = () => {
  return (
    <div className="modal__container">
      <iframe
        width="350"
        height="430"
        allow="microphone;"
        src="[https://console.dialogflow.com/api-client/demo/embedded/73a2021a-161e-4568-b8cc-6248809a87c0](https://console.dialogflow.com/api-client/demo/embedded/73a2021a-161e-4568-b8cc-6248809a87c0)"
      ></iframe>
    </div>
  );
};

export default ChatbotModal;
